commits.content:
.dp {
    height: 20px;
    width: 20px;
    border: 1px solid var(--secondary);
    border-radius: 50%;
    position: relative;
    overflow: hidden;
}

.dp>img {
    width: 100%;
    height: 100%;
    -o-object-fit: cover;
    object-fit: cover;
    overflow: hidden;
}

.user-tab {
    column-gap: 8px;
    align-items: center;
}

.grow-dp {
    flex-grow: 1; 
}

.grow-user {
    flex-grow: 4; 
}
